return $input.all().map(item => {
  const data = item.json.result || {};
  let phone = data.formatted_phone_number || null;

  return {
    json: {
      companyName: data.name || null,
      number: phone,
      address: data.formatted_address || null,
      website: data.website || null
    }
  };
});
